description:
Levi heard from a friend that their buddy's mom works at a strip club. He waits for her return home and makes an excuse to go inside because he knows her son isn't home. He sits there anxiously before he musters up the courage to ask about her profession, she quickly admit that she does work there and knows just what to do to have Levi keep his mouth shut.


